import React, { Component } from "react";

class DateAuthor extends Component {
  state = {};
  render() {
    return (
      <div>
        <span>Vivan Marwaha</span>
        <span style={{ backgroundColor: "black", width: 4, height: 20 }}></span>
        <span>November 19, 2020</span>
      </div>
    );
  }
}

export default DateAuthor;
